// src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import HomePage from './components/HomePage';
import ComparisonPage from './ComparisonPage';  // Example for another page

function App() {
  return (
    <Router>
      <div className="App">
        <Switch>
          <Route path="/" exact component={HomePage} />  {/* HomePage route */}
          <Route path="/comparison" component={ComparisonPage} />  {/* Another route for comparison page */}
        </Switch>
      </div>
    </Router>
  );
}

export default App;
